import React from 'react'
import { Wrapper } from './style'

const students = [{
    name:"Abhiraj",
    rollno:"01"
},
{
    name:"Aaveen",
    rollno:"02"
}
]

const ClassIA = () => {

  return (
    <Wrapper>
    {
        students.map((student) => <div key={student.rollno}>
            <div>
                {student.rollno} {student.name} <input type="button" value="Mark" /> <input type="button" value="View" />
            </div>
            </div>)
    }
    </Wrapper>
  )
}

export default ClassIA
